INSERT INTO `testimonials` (`id`, `name`, `desc`, `star`, `is_active`, `is_deleted`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Shawn Pitts', '<p>Our competitive youth baseball team has been using the BB Sports Training facilities for the past two years. Shea is great to work with and does everything he can to create a schedule that works for the team. The facilities offer us everything we need to stay tuned during the indoor months. Shea has also worked with both of my sons individually providing incredible hitting instruction. I would highly recommend the facilities and the incredible coaches working at the facilities.</p>\r\n', NULL, 1, 0, '2021-12-06 13:54:59', '2022-02-02 23:08:01', NULL),
(2, 'Brody Knauer', '<p>Very organized and professional experienced management, the facility is well taken care of and offers a ton of awesome gadgets from swing analysis to velocity! Also great coaching and instruction from a well rounded and enthusiastic Coach Bell!</p>\r\n', NULL, 1, 0, '2021-12-06 13:57:24', '2022-01-03 17:12:24', NULL),
(3, 'Jackson Johnson', '<p>This place gets down to business! The staff and coaches that BB Sports has to offer to the community are very well knowledged, committed, and ambitious. This is the program you want to put your baseball/softball child into. BB Sports best in town.</p>\r\n', NULL, 1, 0, '2021-12-20 12:32:27', '2022-01-03 17:12:54', NULL),
(7, 'Matt Carver', '<p>Shea has put a lot of time and effort into making BB Sports a prime facility for baseball/softball training. I&rsquo;ve sent several players there to work with him to improve their game. He does everything he can to make sure you get your money&rsquo;s worth. The facility is well kept and professional!</p>\r\n', NULL, 1, 0, '2022-01-03 17:17:18', '2022-01-03 17:17:18', NULL),
(8, 'David Flanigan', '<p>Great facility with everything to help athletes grow from, bands, hitting cage, top of the line pitching machine for hitting, pitching mound, and plenty of space for your off-season training.</p>\r\n', NULL, 1, 0, '2022-01-03 17:18:18', '2022-01-03 17:18:18', NULL),
(9, 'Mary Withey', '<p>Top notch indoor training facility offering the newest equipment available for softball and baseball practice. If you&rsquo;re looking for a place to practice, this is it! Highly recommended! My daughter has been receiving batting lessons for some time now and she has made huge and noticeable improvements! Shea provides excellent coaching and advice!</p>\r\n', NULL, 1, 0, '2022-01-03 17:19:06', '2022-01-03 17:19:06', NULL),
(10, 'Jake Dollarhide', '<p>This facility is an amazing place with state of the art equipment to improve every part of your game weather it&rsquo;s baseball or softball. Coach Shea and Coach Rogs are not only amazing coaches but great guys as well. They have great baseball backgrounds and knowledge for the game. They truly care about the kids that they are coaching and helping out always having the passion to help kids improve and get better every single day. This is the best facility and with the best coaching staff around!</p>\r\n', NULL, 1, 0, '2022-01-03 17:19:48', '2022-01-03 17:19:48', NULL);
